var jbImagesDialog={resized:false,iframeOpened:false,timeoutStore:false,inProgress:function(){document.getElementById("upload_infobar").style.display="none";document.getElementById("upload_additional_info").innerHTML="";document.getElementById("upload_form_container").style.display="none";document.getElementById("upload_in_progress").style.display="block";this.timeoutStore=window.setTimeout(function(){document.getElementById("upload_additional_info").innerHTML='This is taking longer than usual.<br />An error may have occurred.<br /><a href="#" onClick="jbImagesDialog.showIframe()">View script\'s output</a>'},20000)},showIframe:function(){if(this.iframeOpened==false){document.getElementById("upload_target").className="upload_target_visible";this.iframeOpened=true}},uploadFinish:function(a){if(a.resultCode=="failed"){window.clearTimeout(this.timeoutStore);document.getElementById("upload_in_progress").style.display="none";document.getElementById("upload_infobar").style.display="block";document.getElementById("upload_infobar").innerHTML=a.result;document.getElementById("upload_form_container").style.display="block";if(this.resized==false){this.resized=true}}else{document.getElementById("upload_in_progress").style.display="none";document.getElementById("upload_infobar").style.display="block";document.getElementById("upload_infobar").innerHTML="Upload Complete";var b=this.getWin();tinymce=b.tinymce;tinymce.EditorManager.activeEditor.insertContent('<img src="'+a.filename+'">');this.close()}},getWin:function(){return(!window.frameElement&&window.dialogArguments)||opener||parent||top},close:function(){var a=this;function b(){tinymce.EditorManager.activeEditor.windowManager.close(window);tinymce=tinyMCE=a.editor=a.params=a.dom=a.dom.doc=null}if(tinymce.isOpera){this.getWin().setTimeout(b,0)}else{b()}}};